import React from "react";
import Card from "../../common/card";
import { Row, Col, Container } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import "./movie.css";

function Movies(props) {
  const movies = [
    { name: "mai", id: 1 },
    { name: "mm", id: 2 },
    { name: "mm", id: 3 },
    { name: "mm", id: 4 },
    { name: "mm", id: 5 },
    { name: "mm", id: 6 },
    { name: "mm", id: 7 },
    { name: "mm", id: 8 },
  ];

  return (
    <Container className="movies">
      <Row>
        {movies.map((movie) => (
          <Col xs={6} lg={3}>
            <div className="card-div" key={movie.id}>
              <Card imgSrc ={movie}/>
            </div>
          </Col>
        ))}
      </Row>
    </Container>
  );
}

export default Movies;
